(English version below)


Sehr geehrte Nutzer der Evaluierungsplattform,

{% if grade_documents_exist %}Noten der folgenden Kurse wurden soeben veröffentlicht:
{% for course in grade_document_courses %}    - {{ course.name_de }}
{% endfor %}{% endif %}
{% if evaluation_results_exist %}Evaluierungsergebnisse der folgenden Kurse wurden soeben veröffentlicht:
{% for course in evaluation_results_courses %}    - {{ course.name_de }}
{% endfor %}{% endif %}
Die Ergebnisse können auf EvaP (https://evap.hpi.de) eingesehen werden.

Bei Fragen und Rückmeldungen stehen wir gerne zur Verfügung (evaluierung@hpi.de).

Freundliche Grüße,
der Fachschaftsrat IT-Systems Engineering

(Dies ist eine automatisch versendete E-Mail.)


--


Dear users of the evaluation platform,

{% if grade_documents_exist %}grades for the following courses have just been published:
{% for course in grade_document_courses %}    - {{ course.name_en }}
{% endfor %}{% endif %}
{% if evaluation_results_exist %}evaluation results of the following courses have just been published:
{% for course in evaluation_results_courses %}    - {{ course.name_en }}
{% endfor %}{% endif %}
You can view the results on EvaP (https://evap.hpi.de).

If you have any questions or feedback, please let us know (evaluierung@hpi.de).

Kind regards,
The Student Representatives at HPI

(This is an automated message.)
